import React from 'react'

function Cages() {
  return (
    <div>Cages
fish cage business where they keep fish like 
                <ol> 
                    <li class="cage">Tilapia</li>
                    <li class="cage">Nailpach</li>

                </ol>
                    <img src="./images/fish cage 1.jpg" alt="a photo of the cages" title="tilapia cages "/>
                    <img src="./images/fish cage 2.jpg" alt="a photo of the cages nearer" title="nailpach cages"/>          
    </div>
  )
}

export default Cages ;
